import React from 'react';
import './Header.css'

function Header() {
    return (
        <div className="Header">
       <h1>Lesley Moore</h1>
       <a href="#">About Me</a>
       <a href="#">Portfolio</a>
       <a href="#">Contact</a>
       <a href="#">Resume</a>
        </div> );
}

export default Header;
